import React, { useState } from 'react';
import { motion } from 'framer-motion';
import styled from 'styled-components';
import ComprehensiveApp from './components/ComprehensiveApp';
import CHCWorkforceApp from './components/CHCWorkforceApp';
import Header from './components/Header';
import ExecutiveSummary from './components/ExecutiveSummary';
import KeyFindings from './components/KeyFindings';
import SpecialtyAnalysis from './components/SpecialtyAnalysis';
import PredictiveFactors from './components/PredictiveFactors';
import Methodology from './components/Methodology';
import PolicyImplications from './components/PolicyImplications';
import Footer from './components/Footer';
import './App.css';

const AppSelector = styled.div`
  position: fixed;
  top: 20px;
  right: 20px;
  z-index: 1000;
  background: white;
  border-radius: 15px;
  padding: 15px;
  box-shadow: 0 5px 20px rgba(0,0,0,0.2);
`;

const SelectorButton = styled.button`
  background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'white'};
  color: ${props => props.active ? 'white' : '#64748b'};
  border: 2px solid ${props => props.active ? '#1e3a8a' : '#e5e7eb'};
  padding: 8px 16px;
  border-radius: 8px;
  font-size: 0.85rem;
  font-weight: 600;
  cursor: pointer;
  margin: 2px;
  transition: all 0.3s ease;

  &:hover {
    background: ${props => props.active ? 'linear-gradient(135deg, #1e3a8a, #3730a3)' : 'rgba(30, 58, 138, 0.1)'};
    border-color: #1e3a8a;
  }
`;

const containerVariants = {
  hidden: { opacity: 0 },
  visible: {
    opacity: 1,
    transition: {
      staggerChildren: 0.2
    }
  }
};

const itemVariants = {
  hidden: { y: 50, opacity: 0 },
  visible: {
    y: 0,
    opacity: 1,
    transition: {
      duration: 0.8,
      ease: "easeOut"
    }
  }
};

function App() {
  return (
    <motion.div 
      className="app"
      variants={containerVariants}
      initial="hidden"
      animate="visible"
    >
      <div className="newsletter-container">
        <motion.div variants={itemVariants}>
          <Header />
        </motion.div>

        <div className="content-wrapper">
          <motion.div variants={itemVariants}>
            <ExecutiveSummary />
          </motion.div>

          <motion.div variants={itemVariants}>
            <KeyFindings />
          </motion.div>

          <motion.div variants={itemVariants}>
            <SpecialtyAnalysis />
          </motion.div>

          <motion.div variants={itemVariants}>
            <PredictiveFactors />
          </motion.div>

          <motion.div variants={itemVariants}>
            <Methodology />
          </motion.div>
        </div>

        <motion.div variants={itemVariants}>
          <PolicyImplications />
        </motion.div>

        <motion.div variants={itemVariants}>
          <Footer />
        </motion.div>
      </div>
    </motion.div>
  );
}

export default App;
